import React, { useState, useRef } from 'react';

function DodajUzytkownika() {
  const [formState, setFormState] = useState({
    imie: "",
    nazwisko: "",
    dataUrodzenia: "",
    pesel: "",
    adresZamieszkania: "",
    adresKorespondencyjny: "",
    password: "",
    confirmPassword: ""
  });

  const [isCopied, setIsCopied] = useState(false);
  const passwordRef = useRef();

  const generatePassword = () => {
    const length = 20;
    const charset = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789!@#$%^&*";
    let retVal = "";
    for (let i = 0, n = charset.length; i < length; ++i) {
      retVal += charset.charAt(Math.floor(Math.random() * n));
    }
    setFormState({ ...formState, password: retVal, confirmPassword: retVal });
    setIsCopied(false); 
  };

  const handleChange = (e) => {
    setFormState({ ...formState, [e.target.name]: e.target.value });
    if (e.target.name === 'password' || e.target.name === 'confirmPassword') {
      setIsCopied(false); // Odblokuj przycisk po wprowadzeniu nowego hasła
    }
  };

  const handleCopy = () => {
    passwordRef.current.select();
    document.execCommand("copy");
    setIsCopied(true);
  };

  const handleSubmit = () => {
    // Tutaj musisz wysłać formState, który zawiera wartości wszystkich pól
    fetch('/adduser', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(formState),
    })
    .then(response => response.json())
    .then(data => console.log(data))
    .catch((error) => {
      console.error('Error:', error);
    });
  };

  return (
  <>
    <div className='dodajUzytkownika'>

      <div className='COL11'>
        <div>Imię</div>
        <div>Nazwisko</div>
        <div>Data urodzenia</div>
        <div>PESEL</div>
        <div>Adres zamieszkania</div>
        <div>Adres adres korespondencyjny</div>
        <div className='myContainer'>
          <div>Hasło</div>
          {(formState.password && formState.confirmPassword && formState.password === formState.confirmPassword) &&
            <div className='btn-kopiuj'>
              <button onClick={handleCopy} disabled={isCopied}>Kopiuj</button>
            </div>
          }
        </div>
        <div className='haslo2'>Powtórz hasło</div>
      </div>

      <div className='COL22'>
        <input type='text' value={formState.imie} onChange={handleChange} name='imie'></input>
        <input type='text' value={formState.nazwisko} onChange={handleChange} name='nazwisko'></input>
        <input type='text' value={formState.dataUrodzenia} onChange={handleChange} name='dataUrodzenia'></input>
        <input type='text' value={formState.pesel} onChange={handleChange} name='pesel'></input>
        <input type='text' value={formState.adresZamieszkania} onChange={handleChange} name='adresZamieszkania'></input>
        <input type='text' value={formState.adresKorespondencyjny} onChange={handleChange} name='adresKorespondencyjny'></input>
        <input value={formState.password} type="password" ref={passwordRef} onChange={handleChange} name="password" />
        <input value={formState.confirmPassword} type="password" onChange={handleChange} name="confirmPassword" />
      </div>
      <div className='generujHasloDiv'>
        <div className='odw'>
          <button onClick={generatePassword}>Generuj hasło</button>
        </div>
      </div>
    </div>
    <div>
      <button onClick={handleSubmit}>Dodaj</button>
    </div>
  </>
  );
};

export default DodajUzytkownika;
